import React from "react";
import { Link } from "react-router-dom";
import { useKeycloak } from "@react-keycloak/web";

const Navbar = () => {
  const { keycloak } = useKeycloak();

  return (
    <nav style={{ padding: "10px", background: "#333", color: "white" }}>
      <Link to="/dashboard" style={{ color: "white", marginRight: "15px" }}>Dashboard</Link>
      <Link to="/profile" style={{ color: "white", marginRight: "15px" }}>Profile</Link>

      {keycloak.authenticated ? (
        <button onClick={() => keycloak.logout()} style={{ background: "red", color: "white", border: "none", padding: "5px 10px", cursor: "pointer" }}>
          Logout
        </button>
      ) : (
        <Link to="/login" style={{ color: "white", marginLeft: "15px" }}>Login</Link>
      )}
    </nav>
  );
};

export default Navbar;
